C.T_=new Q.qP("MeloDonG","https://melodong.com/","Game Development Enginner Intern","            There are three main things I worked on at MeloDong: building the gaming environment, managing the character animation, and applying logics using scripts. I worked in Unity Engine and used C# scripts.\n\n            For the environments, I trimmed the imported models, adjusted the lighting and added extra obstacles according to the scene.\n\n            For the animations, I mostly used the external .fbx files and did a few manual adjustments myself. I applied different animations to each characters (zombies, dragons, bats, etc.) as well as the animation transitions.\n \n            I spent most of the time writing scripts to mange the game flow. For instance, I wrote C# scripts to determine what the walking pattern of a zombie would be like, what happens if the bullet hits an enemy, what effects would be applied if an enemy attacks the main character, what happens if an enemy dies, etc.\n \n                                    ","assets/videos/melodong-1.mov",4,null)
